int main(int argc, char *argv[]) {
  if (argc != 2) {
    printf("Usage: %s <filename>\n", argv[0]);
    return 1;
  }

  FILE *f = fopen(argv[1], "r");
  if (f == NULL) {
    printf("Error opening file %s\n", argv[1]);
    return 1;
  }

  char line[1024];
  while (fgets(line, 1024, f)) {
    char *token = strtok(line, " ");
    while (token) {
      printf("%s\n", token);
      token = strtok(NULL, " ");
    }
  }

  fclose(f);

  return 0;
}
function readFile(filePath) {
    return new Promise(function(resolve, reject) {
        fs.readFile(filePath, 'utf8', function(err, data) {
            if (err) {
                reject(err);
            } else {
                resolve(data);
            }
        });
    });
}

function writeFile(filePath, data) {
    return new Promise(function(resolve, reject) {
        fs.writeFile(filePath, data, function(err) {
            if (err) {
                reject(err);
            } else {
                resolve();
            }
        });
    });
}

function appendFile(filePath, data) {
    return new Promise(function(resolve, reject) {
        fs.appendFile(filePath, data, function(err) {
            if (err) {
                reject(err);
            } else {
                resolve();
            }
        });
    });
}

module.exports = {
    readFile: readFile,
    writeFile: writeFile,
    appendFile: appendFile
};
import os
import sys

def main(argv):
    if len(argv) != 2:
        print('Usage: python file.py [filename]')
        sys.exit(1)

    filename = argv[1]
    if not os.path.exists(filename):
        print('Error: file %s does not exist' % filename)
        sys.exit(1)

    if os.path.isdir(filename):
        print('Error: %s is a directory' % filename)
        sys.exit(1)

    print(file_type(filename))

def file_type(filename):
    with open(filename, 'rb') as f:
        file_start = f.read(32)
        file_type = None
        for file_sig in file_signatures:
            if file_start.startswith(file_sig[1]):
                file_type = file_sig[0]
                break
        if file_type is not None:
            return file_type
        else:
            return 'Unknown'

file_signatures = [
    ('JPEG', b'\xff\xd8\xff'),
    ('PNG', b'\x89PNG\r\n\x1a\n'),
    ('GIF', b'GIF87a')
]

if __name__ == '__main__':
    main(sys.argv)
